443	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ObjetoConstruccionTipo	\N	16	Fachada.Pobre	\N	f	(Fachada) Pobre	-Puerta:  Fabricada con materiales como: Maderas burdas, lámina de zinc, lata o latones carecen por completo de lujos.\n\n-Ventanas:  En la gran mayoría de casos son pequeñas, en madera burda o ángulo de hierro sencillo.\n\n-Cubrimiento del muro:  Generalmente los muros no tienen cubrimiento, se presentan con ladrillo corrientes o bloque a la vista y en algunos casos pintura de cal o carburo directamente sobre el ladrillo, y en ocasiones pañete sin pintar o con pinturas muy económicas.
444	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ObjetoConstruccionTipo	\N	17	Fachada.Sencilla	\N	f	(Fachada) Sencilla	-Puerta:  En maderas sin trabajar o láminas metálicas sin ornamentación\n\n-Ventanas:  Pequeñas o de regular tamaño, en madera sin trabajo ornamental o metal con pintura de aceite.\n\n-Cubrimiento de muros:  En la mayoría de los casos se encuentran pañetes con pinturas económicas, o ladrillo prensado a la vista, generalmente un solo plano en el frente.
445	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ObjetoConstruccionTipo	\N	18	Fachada.Regular	\N	f	(Fachada) Regular	-Puerta de distintos tamaños, construidas en madera elaborada, o metal en lámina doblada, con rejas en ornamentación metálica en la mayoría de los casos.\n\n-Cubrimiento:  Se encuentran frecuentemente pañetados y enlucidos con pintura de regular calidad; en urbanizaciones se utiliza bastante el pañete rústico pintado con cal o carburo.  Otras opciones son: En ladrillo prensado a la vista, el granito y la chapa de piedra de presentación sencilla.  Hasta dos planos enfrente y con una longitud entre 7 y 8 mts, con antejardín, donde la puerta de garaje forma parte integral de esta fachada.
446	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ObjetoConstruccionTipo	\N	19	Fachada.Buena	\N	f	(Fachada) Buena	-Puertas en maderas con cierto trabajo manual; en algunos casos en lámina prensada (pintada en aceite o en muy pocos casos al duco) con metal ornamentado y vidrio martillado.\n\n-Ventanas:  Amplias, en lámina prensada o madera trabajada, pintura de aceite.  Las ventanas ocupan buena parte del frente y la fachada.\n\n-Cubrimiento:  Pañete en cemento, pintura en vinilo, ladrillo prensado a la vista pintado en aceite, granito rústico fino pintado en vinilo, piedra pulida.\n\n-La fachada presenta varios planos y tiene una longitud entre 10 y 14 mts, en el cual la puerta del garaje, en ocasiones doble, participa en forma importante.
