577	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_RestriccionTipo	\N	2	Servidumbre.Aire	\N	f	(Servidumbre) Aire	Permite realizar y mantener las obras necesarias para la eficiencia y segura ventilación. Las empresas de servicios públicos podrán pasar por predios ajenos por vía aérea y realizar en ellos las actividades necesarias para prestar el servicio. (Artículo 215 del Decreto 1275 de 1970, artículo 57 de la Ley 142 de 1994).
578	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_RestriccionTipo	\N	3	Servidumbre.Energia_Electrica	\N	f	(Servidumbre) Energía eléctrica	Supone para las entidades públicas que tienen a su cargo la construcción de centrales generadoras, líneas de interconexión, transmisión y prestación del servicio público de distribución de energía eléctrica, la facultad de pasar por los predios afectados, por vía aérea, subterránea o superficial, las líneas de transmisión y distribución del fluido eléctrico, ocupar las zonas objeto de servidumbre, transitar por los mismos, adelantar las obras, ejercer la vigilancia, conservación y mantenimiento y emplear los demás medios necesarios para su ejercicio. (Artículo 18 de la Ley 126 de 1938 y Artículo 25 de la Ley 56 de 1981). (Artículo 57 de la Ley 142 de 1994).
579	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_RestriccionTipo	\N	4	Servidumbre.Gasoducto	\N	f	(Servidumbre) Gasoducto	Es el conjunto de actividades ordenadas a la distribución de gas combustible, por tubería u otro medio, desde un sitio de acopio de grandes volúmenes o desde un gasoducto central hasta la instalación de un consumidor final, incluyendo su conexión y medición.\nSe constituye la servidumbre a favor de la explotación de los gases derivados del petróleo.\nCuando sea necesario las empresas que prestan el servicio podrán pasar por predios ajenos por vía subterránea o superficial los cables o tuberías, ocupar temporalmente las zonas que requieren esos predios, remover los cultivos y obstáculos de toda clase que se encuentren en ellos, transitar, adelantar las obras y ejercer vigilancia en ellos y en general realizar todas las actividades necesarias para prestar el servicio.\nLas líneas de distribución de gas combustible, podrán atravesar los ríos, caudales, líneas férreas, puentes, calles, caminos, y cruzar acueductos, oleoductos, y otras líneas o conducciones. (Art. 14 númeral 28, y artículo 57 de la Ley 142 de 1994).
580	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_RestriccionTipo	\N	5	Servidumbre.Luz	\N	f	(Servidumbre) Luz	Tiene por objeto dar luz a un espacio cualquiera, cerrado y techado.\nSe llama predio sirviente el que debe permitir el paso de la luz y predio dominante el que tiene derecho a ella. (Artículos 931 al 935 del Código Civil).
581	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_RestriccionTipo	\N	6	Servidumbre.Oleoducto	\N	f	(Servidumbre) Oleoducto	Se constituye a favor de la explotación de petróleo, comprendiendo el terreno suficiente para las estaciones de bombeo y demás dependencias necesarias para el funcionamiento de los oleoductos y el de establecer muelles, cargaderos y tuberías submarinas y fluviales. (Artículo 9 Decreto 1056 de 1954).
582	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_RestriccionTipo	\N	7	Servidumbre.Agua	\N	f	(Servidumbre) Agua	El predio inferior está sujeto a recibir las aguas que descienden del predio superior naturalmente, es decir, sin que la mano del hombre contribuya a ello. No se puede, por consiguiente, dirigir un albañal o acequia sobre el predio vecino, si no se ha constituido esta servidumbre especial. En el predio servil no se puede hacer cosa alguna que estorbe la servidumbre natural, ni el predio dominante, que la grave.
583	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_RestriccionTipo	\N	8	Servidumbre.Minera	\N	f	(Servidumbre) Minera	Para el ejercicio eficiente de la industria minera en todas sus fases y etapas, podrán establecerse las servidumbres que sean necesarias sobre los predios ubicados dentro o fuera del área objeto del título minero. Cuando, para la construcción, el montaje, la explotación, el acopio y el beneficio, en ejercicio de las servidumbres se requiera usar recursos naturales renovables, será indispensable que dicho uso esté autorizado por la autoridad ambiental, cuando la ley así lo exija. También procede el establecimiento de servidumbre sobre zonas, objeto de otros títulos mineros. Tales gravámenes no podrán impedir o dificultar la exploración o la explotación de la concesión que los soporte. (Art 166 Ley 685 de 2001)
584	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_RestriccionTipo	\N	9	Servidumbre.Legal_Hidrocarburos	\N	f	(Servidumbre) Legal de hidrocarburos	La industria de los hidrocarburos está declarada de utilidad pública en sus ramos de exploración, producción, transporte, refinación y distribución. Los predios deberán soportar todas las servidumbres legales que sean necesarias para realizar las actividades de exploración, producción y transporte de los hidrocarburos, salvo las excepciones establecidas por la ley. Se entenderá que la servidumbre de ocupación de terrenos comprenderá el derecho a construir la infraestructura necesaria en campo e instalar todas las obras y servicios propios para beneficio del recurso de los hidrocarburos y del ejercicio de las demás servidumbres que se requieran. (Art. 1 Ley 1274 de 2009)
585	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_RestriccionTipo	\N	10	Servidumbre.Medianeria	\N	f	(Servidumbre) Medianeria	Es el conjunto de derechos y obligaciones que dimanan de la existencia y disfrute en común de una pared, cerca, vallado, etc.\nEn todos los casos, y aun cuando conste que una cerca o pared divisoria pertenece exclusivamente a uno de los predios contiguos, el dueño del otro predio tendrá el derecho de hacer la medianería en todo o en parte, aun sin el consentimiento de su vecino, pagándole la mitad del valor del terreno en que está hecho el cerramiento, y la mitad del valor actual de la porción del cerramiento cuya medianería pretende. (Artículo 912 del C.C.).
586	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_RestriccionTipo	\N	11	Servidumbre.Alcantarillado	\N	f	(Servidumbre) Alcantarillado	Gravamen que afecta un predio, permitiendo que sobre el se conduzcan el alcantarillado que benefician a otro predio de diferente propietario.
587	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_RestriccionTipo	\N	12	Servidumbre.Acueducto	\N	f	(Servidumbre) Acueducto	Gravamen que afecta un predio, permitiendo que sobre el se conduzcan las aguas que benefician a otro predio de diferente propietario. (Artículos 919 a 930 del Código Civil; Artículo 214 del Decreto 1275 de 1970. Artículo 57 de la Ley 142 de 1998).
\.


